pragma solidity ^0.4.23;
pragma experimental ABIEncoderV2;

import "zeppelin-solidity/contracts/math/SafeMath.sol";
import "../interfaces/IVoteController.sol";

library PublicVoteStorage { 
    using SafeMath for uint256;

    uint constant private SECONDS_IN_HOUR = (60 * 60);

    struct VoteCandidate { 
        address owner; 
        uint256 ownerStakeValue;

        string value;

        uint256 totalVoteValue;

        mapping(address => uint256) voteValues;
        address[] voters;

        uint256 voteValue;
    }

    struct Vote { 
        uint expirationTimestamp; 

        IVoteController.Candidate winner;
        IVoteController.Candidate loser; 

        VoteCandidate incumbent;
        VoteCandidate challenger;

        address origin; 
        string key; 

        IVoteController.VoteConfiguration configuration; 

        // TODO: This is not ideal , but we need to know how votes split on each side for
        // allowing increasing of voted value
        mapping(address => IVoteController.Candidate) allVoters;
    }

    struct Data { 
        uint numVotes;
        mapping(uint => Vote) votes;
    }

    function exists(Data storage self, uint _voteId) public view returns (bool _exists) { 
        return self.votes[_voteId].expirationTimestamp > 0;
    }

    function active(Data storage self, uint _voteId) public view returns (bool _active)  {
        return self.votes[_voteId].expirationTimestamp != 0 && self.votes[_voteId].expirationTimestamp > block.timestamp;
    }

    function create(Data storage self, IVoteController.VoteDescriptor memory _descriptor) public returns (uint _voteId) { 
        uint voteId = self.numVotes + 1;
        self.numVotes = voteId;
        uint length = _descriptor.configuration.challengeLength;

        require(length >= SECONDS_IN_HOUR, "Expiration must be in the future");

        self.votes[voteId].expirationTimestamp = block.timestamp + length;
        self.votes[voteId].origin = msg.sender;
        self.votes[voteId].key = _descriptor.key;
        self.votes[voteId].configuration = _descriptor.configuration;

        // Copy descriptor properties into vote map
        _copyCandidateValues(self.votes[voteId].incumbent, _descriptor.incumbent);
        _copyCandidateValues(self.votes[voteId].challenger, _descriptor.challenger);

        return voteId;
    }

    function get(Data storage self, uint voteId) private view returns (Vote storage item) { 
        return self.votes[voteId];
    }

    function getConfiguration(Data storage self, uint voteId) public view returns (IVoteController.VoteConfiguration storage item) { 
        return get(self, voteId).configuration;
    }

    function pushVote(Data storage self, uint _voteId, IVoteController.Candidate _candidate, uint256 _stake) public returns (bool _success){ 
        Vote storage vote = get(self, _voteId);

        require (_stake >= vote.configuration.minVoteStake, "Vote stake must be greater than or equal to minimum voting stake.");
        require (_candidate != IVoteController.Candidate.None, "Voting candidate must be valid.");
        require(!addressHasVoted(self, _voteId, msg.sender), "Sender must not already have voted.");

        VoteCandidate storage candidate = getCandidate(self, _voteId, _candidate);

        candidate.voteValues[msg.sender] = _stake;
        candidate.voters.push(msg.sender);
        candidate.totalVoteValue = candidate.totalVoteValue.add(_stake);
        candidate.voteValue = candidate.voteValue.add(_stake);

        vote.allVoters[msg.sender] = _candidate;

        return true;
    }

    function increaseVote(Data storage self, uint _voteId, uint256 _additionalStake) public returns (bool _success){ 
        Vote storage vote = get(self, _voteId);

        require(addressHasVoted(self, _voteId, msg.sender), "Sender required to have previously voted to increate stake.");
        require(_additionalStake >= vote.configuration.minVoteIncrementalStake, "Additional voting stake must be greather than or equal to the minimum incremental voting stake.");


        // Find the candidate for the voter 
        IVoteController.Candidate votedForCandidate = vote.allVoters[msg.sender];

        assert(votedForCandidate != IVoteController.Candidate.None);

        VoteCandidate storage candidate = getCandidate(self, _voteId, votedForCandidate);

        // Increase the vote value by the additional stake
        candidate.voteValues[msg.sender] = candidate.voteValues[msg.sender].add(_additionalStake);
        candidate.totalVoteValue = candidate.totalVoteValue.add(_additionalStake);
        candidate.voteValue = candidate.voteValue.add(_additionalStake);

        return true;
    }

    function deleteVote(Data storage self, uint _voteId) public { 
        delete self.votes[_voteId];
    }

    function getCandidate(Data storage self, uint _voteId,  IVoteController.Candidate _candidate) public view returns (VoteCandidate storage _result) { 
        require(_candidate != IVoteController.Candidate.None);

        VoteCandidate storage voteCandidate = self.votes[_voteId].incumbent;

        if(_candidate == IVoteController.Candidate.Challenger) { 
            voteCandidate = self.votes[_voteId].challenger;
        }

        return voteCandidate;
    }

    function addressHasVoted(Data storage self, uint _voteId, address _voter) public view returns (bool _voted) { 
        return self.votes[_voteId].allVoters[_voter] != IVoteController.Candidate.None;
    }

    function forceExpire(Data storage self, uint _voteId) public returns (bool _success) { 
        require(exists(self, _voteId));
        require(msg.sender == self.votes[_voteId].origin);
        self.votes[_voteId].expirationTimestamp = block.timestamp;
        return true; 
    }

    function _copyCandidateValues(VoteCandidate storage _candidate, IVoteController.VoteCandidateDescriptor memory _descritptor) private 
        returns (bool _success) 
    { 
        _candidate.owner = _descritptor.owner;
        _candidate.value = _descritptor.value;
        _candidate.ownerStakeValue = _descritptor.stake;
        _candidate.totalVoteValue = _descritptor.stake;
        return true;
    }
}
